import OrgDLBalOrder from './OrgDLBalOrder'

import { periodDate } from '../../../api/dashboard/dashboard.js'

export default {
  name: 'IndicatorBoard',
  data() {
    return {
      date: null
    }
  },
  components: {
    PanelGroup,
    ProductBal,
    ProductCustCount,
    TrendAnalysis,
    DepositAnalysis,
    LoanFiveClass,
    BadnessLoan,
    OrgDLBalOrder
